      {tasks.map((task, index) => (
        <Task
          key={index}
          {...task}
          onToggle={(done) => updateTaskDone(index, done)}
        />
      ))}

      {cars && cars.map((car, index) => <Car key={index} car={car} />)}
    </main>
  );
}

export default App;
